'use client';

import { useField } from '@mui/x-date-pickers/internals';
import { useDateTimeRangeManager } from "../managers/index.js";
export const useSingleInputDateTimeRangeField = props => {
  const manager = useDateTimeRangeManager(props);
  return useField({
    manager,
    props
  });
};
